class Intro extends Phaser.Scene{constructor(){super("Intro")}preload(){this.load.image("frame1","frame1.png"),this.load.image("frame2","frame2.png")}create(){let e=this.add.image(0,0,"frame1").setOrigin(0,0),t;e.setInteractive(),e.on("pointerdown",()=>{t=this.add.image(0,0,"frame2").setOrigin(0,0),t.setInteractive(),t.on("pointerdown",()=>{this.scene.stop("Intro"),this.scene.start("Main")})})}}